import "./ExpenseItem.css";

function ExpenseItem() {
	const expenseDate = new Date(2021, 7, 21);
	// const expsenseTitle = "Car Insurance";
	// const expenseAmount = 2345.62;

	return (
		<div className="expense-item">
			<div>{expenseDate}</div>
			<div className="expense-item__description">
				<h2>Car Insurance</h2>
			</div>
			<div className="expense-item__price">{Math.random}</div>
		</div>
	);
}

export default ExpenseItem;
